<script>   
  $(document).ready(function(){
    $('#example1').DataTable({
      "paging": true,
      "lengthChange": false,
      "searching": true,
      "ordering": true,
      "info": false,
      "autoWidth": true,
      "responsive": false,
  });
});

  function select_icon()
  {
    var fa = $('input[name=fa]:checked').val();
    var icon = $('input[name=icon]').val();

    if(fa != null)
    {
      $('input[name=icon]').val(fa);
      $('#i-icon').removeClass();
      $('#i-icon').addClass(fa);
      $('#modal-data-md').modal('hide');
  }
}
